import React from 'react'

export default function ThongTinDatGhe() {
  return (
    <div className='mt-5' style={{textAlight:'left'}}>
        <button className='gheDuocChon textleft' ></button><span className='text-light mx-2'>Ghế Đã Đặt</span>
        <br />
        <button className='gheDangChon textleft' ></button><span className='text-light mx-2'>Ghế Đang Đặt</span>
        <br />
        <button className='ghe textleft' style={{marginLeft:0}}></button><span className='text-light mx-2'>Ghế Chưa Đặt</span>
    </div>
  )
}
